import Navbar from './Navbar';
import Home from './pages/Home';
import About from './pages/About';
//import Dictonary from './Dictonary';


function App() {
  return (
    <div className="App">
        <BrowserRouter>
          <Routes>
            <Route index element = {<Home />} />
            <Route path="/home" element = {<Home />} />
            <Route path="/about" element = {<About />} />
          </Routes>
        </BrowserRouter>
    </div>
  );
}

export default App;
